import React from "react";
import Sidebar from '../components/sidebar';
import { Container, Row, Col } from "react-bootstrap";

const Dashboard = () => {
  return (
    <Container>
      <Row>
        <Col md={2}>
          <Sidebar />
        </Col>
        <Col md={10}>
          <div>
            BLAH BLAH
          </div>
        </Col>
      </Row>
    </Container>
  );
};

export default Dashboard;
